import React from "react";
import { useDispatch } from "react-redux";
import { incrementCell } from "../../../../../../redux/actions";

const IncrementCell = React.forwardRef(({ id, value }, ref) => {
   const dispatch = useDispatch();
   const cellRef = useRef(null);

   return (
      <td ref={ref} onClick={() => dispatch(incrementCell(id, value))}>
         {value}
      </td>
   );
});

export default IncrementCell;
